import React from 'react';




class Token extends React.Component{


    constructor(props){
        super(props);
        this.state = {
            email : "",
            password : ""
        }
    }


    myChange(e){
        this.setState( { email : e.target.value})
    }

    render(){
        return(
            <>

               <input

                type = "text"
                onChange = {this.myChange}



               />

            </>
        )
    }
}

export default Token;
